import './App.css';
import React, { useState } from 'react';


function App() {
    const [obj, setObj] = useState({
		prop1: 'value1',
		prop2: 'value2',
		prop3: 'value3',
	});
	const copy  = Object.assign({}, obj);
    copy.prop1 = '!';
    setObj(copy);

	return <div>
		<div>{copy.prop1}</div>
	</div>;

}
export default App;
